import Header from './components/Header';

function App() {
  return (

    <Routes>

      <Route path ="/" exact element = {<Home/>} /> 
      <Route path ="/" exact element = {<Header/>} /> 
     <Route path ="/" exact element = {<Nav/>} />

    </Routes>

  );
}

export default App;
